import logo from "../../images/logo.png";
import { BannerWrapper, Logo, ScrollingText, ScrollingText2, SocialLogo, SocialRow, Socials, Wrapper } from "./styled";
import bg from "../../images/background.png";
import tt from "../..//images/icons/4362958_tiktok_logo_social media_icon.svg"
import fb from "../..//images/icons/834722_facebook_icon.svg"
import msg from "../..//images/icons/7086697_messenger_facebook messenger_messenger logo_icon.svg"
import { Tiles } from "./Tiles";

export const Top = () => {
    const text = " Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦   ";
  return (
    <>
    <Wrapper bg={bg}>
      <Logo src={logo} />
      <BannerWrapper>
        <ScrollingText>{text + text + "  "}</ScrollingText>
        <ScrollingText2>{text + text + "  "}</ScrollingText2>
      </BannerWrapper>
    </Wrapper>
    <Tiles/>

<Socials>Zobacz materiały z naszych realizacji:
  <SocialRow>Tiktok <SocialLogo src={tt}/></SocialRow>
    <SocialRow>Facebook <SocialLogo src={tt}/></SocialRow>
      <SocialRow>Instagram <SocialLogo src={tt}/></SocialRow>
</Socials>

 facebook, instagram

       <iframe
  src="https://www.facebook.com/plugins/video.php?height=476&href=https%3A%2F%2Fwww.facebook.com%2F100048795611189%2Fvideos%2F4036504009997999%2F&show_text=false&width=267&t=0"
  width="267"
  height="476"
  style={{ border: "none", overflow: "hidden" }}
  scrolling="no"
  frameBorder="0"
  allowFullScreen={true}
  allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"
/>

    </>
  );
};
